import axios from 'axios';

const API_URL = process.env.VUE_APP_API_URL || 'http://localhost:5000';

export default {
  // 获取充电站列表
  getStations() {
    return axios.get(`${API_URL}/api/stations`);
  },
  
  // 获取机器人列表
  getRobots() {
    return axios.get(`${API_URL}/api/robots`);
  },
  
  // 获取KPI数据
  getKpiData(params) {
    return axios.get(`${API_URL}/api/energy-efficiency/kpi`, { params });
  },
  
  // 获取充电效率趋势
  getEfficiencyTrend(params) {
    return axios.get(`${API_URL}/api/energy-efficiency/efficiency-trend`, { params });
  },
  
  // 获取能耗分布
  getEnergyConsumptionDistribution(params) {
    return axios.get(`${API_URL}/api/energy-efficiency/energy-distribution`, { params });
  },
  
  // 获取充电站利用率
  getStationUtilization(params) {
    return axios.get(`${API_URL}/api/energy-efficiency/station-utilization`, { params });
  },
  
  // 获取机器人充电行为分析
  getRobotChargingBehavior(params) {
    return axios.get(`${API_URL}/api/energy-efficiency/robot-charging-behavior`, { params });
  },
  
  // 获取充电高峰期分析
  getChargingPeakAnalysis(params) {
    return axios.get(`${API_URL}/api/energy-efficiency/peak-analysis`, { params });
  },
  
  // 获取充电事件列表
  getChargingEvents(params) {
    return axios.get(`${API_URL}/api/energy-efficiency/charging-events`, { params });
  },
  
  // 导出数据
  exportData(params) {
    return axios.get(`${API_URL}/api/energy-efficiency/export`, { 
      params,
      responseType: 'blob'
    });
  }
};
